import{_ as e,o as t,c as o,O as a}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 23.1-3208 Regulations.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/23.1-3208.md","filePath":"vacode/23.1-3208.md"}'),r={name:"vacode/23.1-3208.md"},n=a('<h1 id="§-23-1-3208-regulations" tabindex="-1">§ 23.1-3208 Regulations. <a class="header-anchor" href="#§-23-1-3208-regulations" aria-label="Permalink to &quot;§ 23.1-3208 Regulations.&quot;">​</a></h1><p>A. The board or its executive committee may adopt regulations concerning the use and visitation of properties under the control of the Jamestown-Yorktown Foundation to protect and secure such properties and the public enjoyment of such properties.</p><p>B. Any person who knowingly violates a regulation of the Foundation may be requested by an agent or employee of the Foundation to leave the property and upon the failure of such person to do so is guilty of trespass as provided in § <a href="http://law.lis.virginia.gov/vacode/18.2-119/" target="_blank" rel="noreferrer">18.2-119</a>.</p><p>1998, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?981+ful+CHAP0786" target="_blank" rel="noreferrer">786</a>, § 23-289; 2016, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0588" target="_blank" rel="noreferrer">588</a>; 2017, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?171+ful+CHAP0314" target="_blank" rel="noreferrer">314</a>.</p>',4),i=[n];function s(l,c,p,d,_,h){return t(),o("div",null,i)}const f=e(r,[["render",s]]);export{g as __pageData,f as default};
